struct
{
   double geometry[8][3];
   double displacement[8][3];
   double mass_scaled_displacement[8][3];
   double q[18];
} input_molecule;

double geometry_conversion_factor()
{
   if(input.units == "au") return 1.0;
   else if(input.units == "aa") return 1.889726124993590e+00;
   else throw std::runtime_error("Unknown conversion units: " + input.units);
}

void read_molecule_input(const std::string& filename)
{
   std::ifstream input_file(filename);
   std::string str;
   int counter = 0;
   while(std::getline(input_file, str))
   {
      if(counter >= 8)
      {
         throw std::runtime_error("Read to many lines in molecule input.");
      }
      auto split = split_string(str);
      if(split.size() != 4)
      {
         throw std::runtime_error("Number of entries on line " + std::to_string(counter + 1) + " is wrong. It is " + std::to_string(split.size()) + "but should be 4.");
      }
      if(split[0] != molecule.atoms[counter])
      {
         throw std::runtime_error("Atom " + std::to_string(counter + 1) + " does not match reference structure.");
      }
      input_molecule.geometry[counter][0] = double_from_string(split[1]) * geometry_conversion_factor();
      input_molecule.geometry[counter][1] = double_from_string(split[2]) * geometry_conversion_factor();
      input_molecule.geometry[counter][2] = double_from_string(split[3]) * geometry_conversion_factor();
      
      ++counter;
   }
   if(counter != 8)
   {
      throw std::runtime_error("Read to few lines in molecule input.");
   }
}

void generate_displacement_and_q()
{
   for(int i = 0; i < 8; ++i)
   {
      input_molecule.displacement[i][0] = input_molecule.geometry[i][0] - molecule.geometry[i][0];
      input_molecule.displacement[i][1] = input_molecule.geometry[i][1] - molecule.geometry[i][1];
      input_molecule.displacement[i][2] = input_molecule.geometry[i][2] - molecule.geometry[i][2];
      input_molecule.mass_scaled_displacement[i][0] = input_molecule.displacement[i][0] * std::sqrt(molecule.masses[i] * 1.822888480000000e+03);
      input_molecule.mass_scaled_displacement[i][1] = input_molecule.displacement[i][1] * std::sqrt(molecule.masses[i] * 1.822888480000000e+03);
      input_molecule.mass_scaled_displacement[i][2] = input_molecule.displacement[i][2] * std::sqrt(molecule.masses[i] * 1.822888480000000e+03);
   }
   
   for(int i = 0; i < 18; ++i)
   {
      input_molecule.q[i] = 0.0;
      for(int j = 0; j < 24; ++j)
      {
         int atom = std::floor(j/3);
         int coord = j%3;
         input_molecule.q[i] += molecule.normal_coordinates[i][j] * input_molecule.mass_scaled_displacement[atom][coord];
      }
   }
}

