/*
 * Wrapper function to evaluate operator 
 */
std::vector<std::pair<std::string, double> > evaluate_operators()
{
   std::vector<std::pair<std::string, double> > evaluated;
   for(const auto& oper : input.operators)
   {
      double value;
      if(false) ;
      else if(oper == "h0")
      {
         value = evaluate_h0(input_molecule.q);
      }
      else
      {
         throw std::runtime_error("Unknown operator (evaluate_operators()) : " + oper);
      }
      evaluated.emplace_back(oper, value);
   }
   if(evaluated.size() == 0)
   {
      evaluated.emplace_back("h0", evaluate_h0(input_molecule.q));
   }
   return evaluated;
}

/*************************************************************** 
 * 
 * Test code 
 * 
 ***************************************************************/
void check_normal_coordinate_orthogonality()
{
   for(int i = 0; i < 18; ++i)
   {
      for(int j = 0; j < 18; ++j)
      {
         double dot = 0.0;
         for(int k = 0; k < 24; ++k)
         {
            dot += molecule.normal_coordinates[i][k] * molecule.normal_coordinates[j][k];
         }
         std::cout << i << " " << j << " dot = " << dot << std::endl;
      }
   }
}

void check_q()
{
   std::cout << " Q VEC " << std::endl;
   for(int i = 0; i < 18; ++i)
   {
      std::cout << input_molecule.q[i] << std::endl;
   }
   std::cout << std::endl;
}

/*************************************************************** 
 * 
 * Main function
 * 
 ***************************************************************/
int main(int argc, char* argv[])
{
   try
   {
      std::cout << std::scientific << std::setprecision(std::numeric_limits<double>::digits10) << std::showpos;
      
      command_line_parser(argc, argv);
      
      if(input.help)
      {
         usage(argc, argv);
      }
      
      if(input.version)
      {
         print_version();
      }
      
      if(input.description)
      {
         print_description();
      }
      
      read_molecule_input(input.filename);
      generate_displacement_and_q();
      
      if(input.debug)
      {
         check_normal_coordinate_orthogonality();
         check_q();
      }
      
      auto evaluated = evaluate_operators();
      for(const auto& oper : evaluated)
      {
         std::cout << oper.first << " = " << oper.second << std::endl;
      }
      
   }
   catch(const std::exception& e)
   {
      std::cout << e.what() << "\n" << std::endl;
      usage(argc, argv);
   }
   
   return 0;
}

